/** 
 * Assert that the given upload/download progress list satisfies the following constraints: <p>- List is not empty - Byte count should be nondecreasing - The last element, and only the last element, should have done=true
 */
private void assertValidProgress(List<Progress> progressList){
  assertFalse(progressList.isEmpty());
  Progress prev=null;
  int index=0;
  for (  Progress progress : progressList) {
    if (prev != null) {
      if (prev.done || prev.bytes > progress.bytes) {
        fail("Progress list out of order at index " + index + ": "+ progressList);
      }
    }
    prev=progress;
    index+=1;
  }
  if (!prev.done) {
    fail("Last progress item should have done=true: " + progressList);
  }
}

